INSERT INTO `lang_definitions` VALUES (5105, 2192, 5, 'Bij het klikken op een invoice nummer verschijnt het \"handleiding posting venster\". Hier kunt u de datum en notities voor de factuur veranderen, de naam selecteren voor wie je invoert en de verzekeringen selecteren waarvoor alle te verwachen betalingen zijn ontvangen. Belangrijker, voor elke facturerings code waarvoor een bedrag in rekening werd gebracht, kunt u de betaling en informatie aanpassen.');
INSERT INTO `lang_definitions` VALUES (5106, 2193, 5, 'Bij het zoeken wordt u een lijst van facturen getoond. U klikt op een van de factuur nummers om een tweede venster te openen, waarbij gegevensinvoer in de pagina handmatige gedaan kan worden. U kunt ook klikken op de naam van een patiënt als je een notitie wilt maken voor de front office medewerkers, zodat deze kunnen zien wanneer de patiënt aankomt en kunt u de facturen selecteren die op de statements van de patiënt verschijnen en deze statements afdrukken.');
