INSERT INTO `lang_definitions` VALUES (8781, 957, 14, 'Jika Anda memilih untuk meng-upload pengiriman uang elektronik, maka jendela pencarian redisplays sendiri dengan pencocokan tagihan dari X12 file. Anda bisa mengklik pada salah satu nomor faktur (seperti yang dijelaskan di bawah) jika anda ingin melakukan koreksi sebelum uang informasi diterapkan. Untuk menerapkan perubahan, klik tombol Proses ERA File di bagian bawah halaman. Ini akan menghasilkan sebuah jendela baru dengan laporan rinci.');
INSERT INTO `lang_definitions` VALUES (8782, 958, 14, 'Jika Anda telah memasuki Tanggal Bayar di halaman pencarian, ini akan menimpa postingan tanggal pembayaran dan penyesuaian lain yang diambil dari file X12. Ini mungkin berguna untuk keperluan laporan, jika Anda ingin menggunakan penerimaan laporan tanggal posting Anda daripada asuransi perusahaan pengolahan tanggal. Catatan bahwa ini juga akan mempengaruhi sebelum tanggal pembayaran dan penyesuaian yang kedua dimasukkan ke dalam klaim.');
